import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './form.css';

class Form extends Component {
    state = {
      username: "",
      password: ""
    };

    setFields = () => {
      this.setState({username: this.un.value, password: this.ps.value})
    }



    render() {
        return (
          <div>
            <div>
              <input ref={(el) => this.un = el} type="text" name="fname" placeholder="Username/Email address">
              </input>
            </div>

            <div>

              <input ref={(el) => this.ps = el} type="text" name="lname" placeholder="Password">
              </input>
            </div>
          </div>
        );
    }
}

export default Form;
